import React, { useState, useEffect } from 'react';
import { StyleSheet, FlatList, Alert, TouchableOpacity, Platform, Linking } from 'react-native';
import { Layout, Text, } from '@ui-kitten/components';
import { ref, onValue, set, get } from 'firebase/database';
import { MyIcon } from '../../components/ui/MyIcon';
import { RouteProp, useNavigation, useRoute } from '@react-navigation/native';
import { StackScreenProps } from '@react-navigation/stack';
import { RootStackParams } from '../../navigation/StackNavigator';
import { database } from '../../../actions/auntentificarFirebase';
import RNHTMLtoPDF from 'react-native-html-to-pdf';
import ReactNativeBlobUtil from 'react-native-blob-util'


interface Props extends StackScreenProps<RootStackParams, 'HistoryScreen'> { }
type HistoryScreenScreenRouteProp = RouteProp<RootStackParams, 'HistoryScreen'>;

type HistorialItem = {
  fecha: string;
  hora: string;
  estado: number;
  EMG: number;
  GSR: number;
};

export const HistoryScreen: React.FC<Props> = () => {
  const route = useRoute<HistoryScreenScreenRouteProp>();
  const navigation = useNavigation();
  const { CI } = route.params;
  const [historial, setHistorial] = useState<HistorialItem[]>([]);
  const [nombreApellido, setNombreApellido] = useState("");
  const [email, setEmail] = useState("");
  const [telefono, setTelefono] = useState("");

  useEffect(() => {
    const cargarHistorial = async () => {
      try {
        //Sincronización con Firebase
        if (CI == null) {
          console.warn('CI es null');
          return;
        }

        const historialRef = ref(database, `users/${CI}/historial/`);
        const unsubscribe = onValue(historialRef, async (snapshot) => {
          const firebaseHistorial = snapshot.val();
          if (firebaseHistorial) {
            const historialArray = Object.entries(firebaseHistorial).flatMap(([fecha, eventos]) =>
              Object.entries(eventos as Record<string, any>).map(([hora, mensaje]) => ({
                fecha,
                hora,
                estado: mensaje.estado, 
                EMG: mensaje.EMG,
                GSR: mensaje.GSR
              }))
            );

            historialArray.sort(
              (a, b) =>
                new Date(`${a.fecha} ${a.hora}`).getTime() -
                new Date(`${b.fecha} ${b.hora}`).getTime()
            );

            setHistorial(historialArray);
          }
        });

        // Limpieza de la suscripción al desmontar el componente
        return () => unsubscribe();
      } catch (error) {
        console.error('Error al cargar el historial:', error);
      }
    };

    cargarHistorial();
  }, [CI]); 

  useEffect(() => {
    const cargarDatos = async () => {
      if (!CI) return;
  
      try {
        const nombreRef = ref(database, `users/${CI}/nombreApellido`);
        const emailRef = ref(database, `users/${CI}/email`);
        const telefonoRef = ref(database, `users/${CI}/telefono`);
  
        const [nombreSnap, emailSnap, telefonoSnap] = await Promise.all([
          get(nombreRef),
          get(emailRef),
          get(telefonoRef),
        ]);
  
        if (nombreSnap.exists()) setNombreApellido(nombreSnap.val());
        if (emailSnap.exists()) setEmail(emailSnap.val());
  
        if (telefonoSnap.exists()) {
          const telefonoValue = telefonoSnap.val().toString(); // Convertir a string
          setTelefono(telefonoValue.startsWith("0") ? telefonoValue : `0${telefonoValue}`);
        }
      } catch (error) {
        console.error("Error al cargar los datos:", error);
      }
    };
  
    cargarDatos();
  }, [CI]);
  


  const generatePDF = async () => {
    let htmlContent = `
    <html>
      <head>
        <style>
          body { font-family: Arial, sans-serif; }
          table { width: 100%; border-collapse: collapse; margin-top: 20px; }
          th, td { border: 1px solid black; padding: 8px; text-align: center; }
          th { background-color: #f2f2f2; }
          .header-container { display: flex; align-items: center; justify-content: center; }
          .logo { width: 80px; height: auto; margin-right: 15px; }
          .title-container { text-align: center; }
          .bold { font-weight: bold; }
          .normal { font-weight: normal; }
        </style>
      </head>
      <body>
        <!-- Encabezado con logo -->
        <div class="header-container">
                    <img src="data:image/jpeg;base64," class="logo" />

          <div class="title-container">
            <h1>HISTORIAL DE RESULTADOS</h1>
            <h3>Dispositivo electrónico de apoyo a la prevención del STC</h3>
          </div>
        </div>
  
        <!-- Datos del paciente -->
        <p class="bold">Cédula de identificación del paciente: <span class="normal">${CI}</span></p>
        <p class="bold">Nombre y apellido: <span class="normal">${nombreApellido}</span></p>
        <p class="bold">Email: <span class="normal">${email}</span></p>
        <p class="bold">Telefono: <span class="normal">${telefono}</span></p>
        <p class="bold">Fecha: <span class="normal">${new Date().toLocaleDateString()}</span></p>
  
        <!-- Tabla de Clave de Valores de Estado -->
        <table class="small-table">
          <thead>
            <tr>
              <th colspan="2">Clave de Valores de Estado</th>
            </tr>
            <tr>
              <th>Estado</th>
              <th>Resultado</th>
            </tr>
          </thead>
          <tbody>
            <tr><td>0</td><td>Normal</td></tr>
            <tr><td>1</td><td>Tenso</td></tr>
            <tr><td>2</td><td>Fatiga</td></tr>
          </tbody>
        </table>
        <!-- Contenedor de recomendaciones -->
        <div style="margin-top: 15px; padding: 10px; border: 1px solid #ccc; border-radius: 8px;">
          <h3 style="margin-bottom: 5px;">Recomendaciones:</h3>
          <ul style="padding-left: 20px;">
            <li>Ejercicios de fortalecimiento: Aprieta una pelota de goma suave para fortalecer los músculos de la mano.</li>
            <li>Estiramientos: Realiza estiramientos suaves.</li>
            <li>Masajes: Masajea suavemente la muñeca.</li>
            <li>Rotaciones de muñeca: Gira suavemente las muñecas en ambas direcciones.</li>
          </ul>
        </div>
        <center>
        <h2>Resultados</h2>
        </center>
        <!-- Tabla de Historial -->
        <table>
          <thead>
            <tr>
              <th>Fecha</th>
              <th>Hora</th>
              <th>Estado</th>
              <th>EMG (µV)</th>
              <th>GSR (Ω)</th>
            </tr>
          </thead>
          <tbody>
            ${historial.map(item => `
              <tr>
                <td>${item.fecha}</td>
                <td>${item.hora}</td>
                <td>${item.estado}</td>
                <td>${item.EMG}</td>
                <td>${item.GSR}</td>
              </tr>
            `).join('')}
          </tbody>
        </table>
      </body>
    </html>
  `;


    try {
      let fileName = `historial_${CI}`;
      let options = {
        html: htmlContent,
        fileName: fileName,
        base64: false,
      };

      const file = await RNHTMLtoPDF.convert(options);

      if (!file.filePath) {
        throw new Error('No se pudo generar el archivo PDF.');
      }

      // Abrir el PDF automáticamente
      if (Platform.OS === 'android') {
        ReactNativeBlobUtil.android.actionViewIntent(file.filePath, 'application/pdf');
      } else {
        Linking.openURL(`file://${file.filePath}`);
      }

    } catch (error) {
      console.error('Error al generar el PDF:', error);
      Alert.alert('Error', `No se pudo generar el PDF: ${error.message}`);
    }
  };
  // Función para borrar el historial y recargar los datos
  const handleDeleteHistory = async () => {
    Alert.alert(
      "Confirmación",
      "¿Seguro que deseas eliminar todo el historial?",
      [
        {
          text: "Cancelar",
          style: "cancel",
        },
        {
          text: "Eliminar",
          onPress: async () => {
            try {
              const historialRef = ref(database, `users/${CI}/historial/`);
              await set(historialRef, null);

              Alert.alert("Historial eliminado", "El historial ha sido eliminado correctamente.");

              setHistorial([]);
            } catch (error) {
              console.error("Error al eliminar historial:", error);
              Alert.alert("Error", "No se pudo eliminar el historial.");
            }
          },
          style: "destructive",
        },
      ]
    );
  };

  return (
    <Layout style={styles.wrapper}>
      <TouchableOpacity style={{ flexDirection: 'row', position: 'absolute', top: 25, right: 70, zIndex: 1, }} onPress={handleDeleteHistory}>
        <MyIcon name="trash-2-outline" />
      </TouchableOpacity>

      <TouchableOpacity
        style={{
          flexDirection: 'row-reverse',
          position: 'absolute',
          left: 10,
          top: 25,
          zIndex: 1,
        }}
        onPress={() => navigation.goBack()}
      >
        <MyIcon name="arrow-back-outline" />
      </TouchableOpacity>
      <TouchableOpacity style={{ flexDirection: 'row', position: 'absolute', top: 25, right: 10, zIndex: 1, }} onPress={generatePDF}>
        <MyIcon name="printer-outline" />
      </TouchableOpacity>



      <Layout style={{ alignItems: 'center', marginBottom: 0 }}>
        <Text category='h1'>Historial</Text>
      </Layout>

      <Layout style={styles.table}>
        <Layout style={styles.table_head}>
          <Layout style={{ width: '28%' }}>
            <Text style={styles.table_caption}>Fecha</Text>
          </Layout>
          <Layout style={{ width: '20%' }}>
            <Text style={styles.table_caption}>Hora</Text>
          </Layout>
          <Layout style={{ width: '20%' }}>
            <Text style={styles.table_caption}>Estado</Text>
          </Layout>
          <Layout style={{ width: '19%' }}>
            <Text style={styles.table_caption}>EMG</Text>
          </Layout>
          <Layout style={{ width: '10%' }}>
            <Text style={styles.table_caption}>GSR</Text>
          </Layout>
        </Layout>

        <FlatList
          data={historial}
          keyExtractor={(_, index) => index.toString()}
          renderItem={({ item }) => (
            <Layout style={styles.table_body}>
              <Layout style={{ width: '26%' }}>
                <Text style={styles.table_data}>{item.fecha}</Text>
              </Layout>
              <Layout style={{ width: '24%' }}>
                <Text style={styles.table_data}>{item.hora}</Text>
              </Layout>
              <Layout style={{ width: '20%' }}>
                <Text style={styles.table_data}>{item.estado}</Text>
              </Layout>
              <Layout style={{ width: '19%' }}>
                <Text style={styles.table_data}>{item.EMG}</Text>
              </Layout>
              <Layout style={{ width: '35%' }}>
                <Text style={styles.table_data}>{item.GSR}</Text>
              </Layout>
            </Layout>
          )}
        />
      </Layout>
    </Layout>
  );
};
const styles = StyleSheet.create({
  wrapper: {
    paddingTop: 40,
    justifyContent: 'center',
    alignItems: 'center',
    flex: 1,
  },
  table: {
    margin: 1,
  },
  table_head: {
    flexDirection: 'row',
    backgroundColor: '#5dade2',
    padding: 10,
  },
  table_caption: {
    // color: 'white',
    fontWeight: 'bold',
    backgroundColor: '#5dade2',
  },
  table_body: {
    flexDirection: 'row',
    padding: 6,
  },
  table_data: {
    fontSize: 11,
  },
  buttonContainer: {
    marginVertical: 10,
    width: '90%',
    paddingBottom: 50,
  },
  pdfButton: {
    padding: 10,
    backgroundColor: '#5dade2',
    borderRadius: 5,
  },
});
